import React from 'react';
import Post from './Components/Post';
import Header from './Components/Header';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <Router>
      <main>
        <Header />
        <Route exact path="/" component={Post} />
        <Route exact path="/" component={Post} />
        <Route exact path="/" component={Post} />
      </main>
    </Router>
  );
}

export default App;
